package Numberpattern;

public class pattern122333 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
				

		for(int i=1;i<=5;i++)     ///pattern 2 34 456 5678 678910
		{         										
				for(int j=1;j<=i;j++)
			{
				System.out.print( i+j);
			}
		System.out.println();
		}
		for(int i=1;i<=5;i++)
		{   for(int j=i;j<=5;j++)
		{
			System.out.print(5);
		}
		System.out.println();
	}

	}
}
